import { useState, useEffect } from "react";

function Users() {
  const [data, setData] = useState([]);

  useEffect(() => {
    fetch("https://jsonplaceholder.typicode.com/users")
      .then(res => res.json())
      .then(info => setData(info));
  }, []);

  return (
    <>
      <h1>Users List</h1>
      {data.map(user => <p key={user.id}>{user.name}</p>)}
    </>
  );
}

export default Users;
